import styled from "styled-components";

export const ButtonContainer = styled.button`
    padding: 20px;
    border: 1px solid #cdcdcd;
    background-color: #0000ff;
    

    button{
    color: #ffffff;
    font-size: 24px;
    font-weight: 700;
    button
    }
`
